webpackJsonp([68728534562763],{3737:function(t,a){t.exports={data:{markdownRemark:{html:'<blockquote>\n<p>相手がどんなに強大だとしても、彼女の前では意味をなさない。</p>\n</blockquote>\n<p>東方永夜抄のマニュアルより。彼女の前に何が立ちはだかろうとも無意味なのだ。それが結界だろうが門番だろうが扉だろうが、たとえ壁だろうが。  描いてから気付いたが、そういえば映画版ドラゴンボールでこんな悪役キャラ居たなぁ。順路無視して、破壊してでも直進しようとするヤツが。今思い出せば、そいつも酒(のようなもの?)を飲み歩いてたし。 さらに気付いたが、<a href="https://ja.wikipedia.org/wiki/Cresteaju">Cresteaju</a>にも該当するキャラが居たなぁ。</p>',frontmatter:{cover:null,date:"2004-09-10T21:07:00+09:00",strDate:"2004/9/10",title:"14 & 15"}}},pathContext:{path:"/ja/blog/2004/09/10-14-15/",langKey:"ja"}}}});
